    value: 64,
  },
  {
    text: 'mistake',
    value: 11,
  },
  {
    text: 'thought',
    value: 16,
  },
  {
    text: 'bad',
    value: 17,
  },
]

function WordCloud() {
  return <ReactWordcloud words={words} />
}

export default WordCloud;
